{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"cell_type":"markdown","source":"# Introduction to Tidyverse\n\n![image.png](attachment:9d306063-9d35-4507-98f2-7360cad045ce.png)\n\n[tidyverse](https://www.tidyverse.org) in R, one of the Important packages in R, there are a lot of new techniques available maybe users are not aware of.\n\nIn this live code-along session, you'll learn the basic principles of analyzing your data using R and the tidyverse. You'll code along to explore the `nycflights13` dataset and discover how you can use packages (i.e. sets of tools for doing stuff with data) in the tidyverse to get from data to insight as intuitively and efficiently as possible. But seriously: if you want to filter your data, you use the verb (or function) `filter`; if you wish to arrange it in a particular order, you use `arrange`. The tidyverse set of tools is a revolution that consists of computational tools that intuitively mirror how we all think about data.\n\nIn this session, we will use Kaggle Notebook and Tidyverse to explore the [`NYC Flights 2013`](https://cran.r-project.org/web/packages/nycflights13/) dataset, which consists of observations of all flights that departed NYC in 2013. The data frame contains all 336,776 flights and the data comes from the US Bureau of Transportation Statistics, and is documented in `?flights`.","metadata":{},"attachments":{"9d306063-9d35-4507-98f2-7360cad045ce.png":{"image/png":""}}},{"cell_type":"markdown","source":"# dplyr package\nThere are five key `dplyr` functions that allow you to solve the vast majority of your data manipulation challenges:\n\n- Pick observations by their values (`filter()`).\n- Reorder the rows (`arrange()`).\n- Pick variables by their names (`select()`).\n- Create new variables with functions of existing variables (`mutate()`).\n- Collapse many values down to a single summary (`summarise()`).\n\nThese can all be used in conjunction with `group_by()` which changes the scope of each function from operating on the entire dataset to operating on it group-by-group. These six functions provide the verbs for a language of data manipulation.\n\n","metadata":{}},{"cell_type":"markdown","source":"## Installation\n\n- Install [R](https://cran.r-project.org/mirrors.html) from here.\n- Install [RStudio](https://www.rstudio.com/products/rstudio/download/) from here.\n- Follow kuanhoong's github repo [here](https://github.com/kuanhoong/tidyverse) to test your set-up (note: it is not necessary to establish communication between Kaggle and Github for this session).\n- Install all the packages in the tidyverse by running `install.packages(\"tidyverse\")` in Kaggle/Google Colab notebook.","metadata":{}},{"cell_type":"code","source":"install.packages(\"tidyverse\")\ninstall.packages(\"lubridate\")\ninstall.packages(\"nycflights13\")\nlibrary(tidyverse)\nlibrary(lubridate)\nlibrary(nycflights13)","metadata":{"execution":{"iopub.status.busy":"2022-05-07T04:49:13.453847Z","iopub.execute_input":"2022-05-07T04:49:13.455846Z","iopub.status.idle":"2022-05-07T04:50:20.363470Z"},"trusted":true},"execution_count":4,"outputs":[{"name":"stderr","text":"Installing package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\nInstalling package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\n── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n\n\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.5     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.8\n\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.6     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n\u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4     \n\n── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n\n\nAttaching package: ‘lubridate’\n\n\nThe following objects are masked from ‘package:base’:\n\n    date, intersect, setdiff, union\n\n\n","output_type":"stream"}]},{"cell_type":"markdown","source":"## Getting Data\nBased on `nycflights13` data, just load the data into R environment.","metadata":{}},{"cell_type":"code","source":"head(flights)","metadata":{"execution":{"iopub.status.busy":"2022-05-05T18:18:24.464171Z","iopub.execute_input":"2022-05-05T18:18:24.465824Z","iopub.status.idle":"2022-05-05T18:18:24.499037Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"summary(flights)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## pipes\n\nUse `%>%` to emphasise a sequence of actions, rather than the object that the actions are being performed on. Learn more about [best practices](https://style.tidyverse.org/pipes.html) of using pipes.","metadata":{}},{"cell_type":"code","source":"flights %>%\nsummary()","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"you can concatenate pipes","metadata":{}},{"cell_type":"code","source":"flights %>%\n  drop_na() %>%\n  summary()","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Wrangle your data\n\nNow it's time to explore your data and get some initial insight into the dataset. You'll be using dplyr verbs such as `filter()`, `arrange()` and `mutate()`, which do exactly what they say.","metadata":{}},{"cell_type":"markdown","source":"## `filter()`\n\nThe `filter` verb chooses only the observations that match the condition.","metadata":{}},{"cell_type":"code","source":"flights %>%\n  filter(origin == \"JFK\")","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"## filter origin == JFK and dest == \"LAX\"\n\nflights %>%\nfilter (origin == \"JFK\" & dest == \"LAX\")","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Exercise 1\n\nFilter all flights flying out from `LGA` on Valentine's day","metadata":{}},{"cell_type":"code","source":"#your code here","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## `arrange()`\n\nUse `arrange()` to sort your observations ","metadata":{}},{"cell_type":"code","source":"## arrange by air_time\n\nflights %>%\narrange(air_time)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"## arrange by air_time in decreasing manner\n\nflights %>%\narrange(desc(air_time))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## `select()`\n\n`select()` allows you to rapidly zoom in on a useful subset using operations based on the names of the variables.","metadata":{}},{"cell_type":"code","source":"# Select columns by name\nselect(flights, year, month, day)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"There are a number of helper functions you can use within `select()`:\n\n- `starts_with(\"abc\")`: matches names that begin with “abc”.\n\n- `ends_with(\"xyz\")`: matches names that end with “xyz”.\n\n- `contains(\"ijk\")`: matches names that contain “ijk”.","metadata":{}},{"cell_type":"code","source":"arrival_flights <- flights %>%\n                    select(starts_with(\"arr\"))\narrival_flights","metadata":{"execution":{"iopub.status.busy":"2022-05-06T00:55:38.063065Z","iopub.execute_input":"2022-05-06T00:55:38.064736Z","iopub.status.idle":"2022-05-06T00:55:38.128976Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# rename()\n\narrival_flights %>%\nrename(arrival_time = arr_time, arrival_delay = arr_delay)","metadata":{"execution":{"iopub.status.busy":"2022-05-06T00:59:21.329754Z","iopub.execute_input":"2022-05-06T00:59:21.331608Z","iopub.status.idle":"2022-05-06T00:59:21.39455Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# rename_with()\n\narrival_flights %>%\nrename_with(toupper)","metadata":{"execution":{"iopub.status.busy":"2022-05-06T01:00:23.433263Z","iopub.execute_input":"2022-05-06T01:00:23.434912Z","iopub.status.idle":"2022-05-06T01:00:23.487623Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Exercise 2\n\nFind flight that left the earliest. Show the tailnum.","metadata":{}},{"cell_type":"code","source":"#your code here","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## `mutate()`\n\nUse `mutate()` to make a new variable.","metadata":{}},{"cell_type":"code","source":"# Create new column flight_time_min = total hour * 60 + minute\nflights %>%\n  mutate(flight_time_min = hour*60 + minute)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# Create new column flight_time_min = total hour * 60 + minute and sort desc\nflights %>%\nmutate(flight_time_min = hour*60 + minute) %>%\narrange(desc(flight_time_min))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Exercise 3\n\nSelect 4 columns:\n- dep_delay\n- arr_delay\n- distance\n- air_time\nand save as `new_flights`\n\ncreate two new variables:\n1. gain_time = dep_delay - arr_delay\n2. speed = distance / air_time * 60\n","metadata":{}},{"cell_type":"code","source":"#your code here","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Summarizing and grouping your data\n\nUse the `summarise()` verb to group and summarise data.","metadata":{}},{"cell_type":"code","source":"# Check out mean air_time\n\nflights %>%\nsummarise(mean_air_time = mean (air_time, na.rm=TRUE), n=n())\n\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"You can also use the `filter()` and `summarise()` verbs to find out the mean `air_time` for flights from `JFK` to `LAX`","metadata":{}},{"cell_type":"code","source":"flights %>%\nfilter (origin == \"JFK\" & dest == \"LAX\") %>%\nsummarise (mean_air_time = mean(air_time, na.rm = TRUE))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## `group_by()`\n`summarise()` is not terribly useful unless we pair it with `group_by()`\n\nUse the `group_by()` and `summarise()` verbs to find the mean `air_time` and `tailnum` as a function for all flights from `JFK` to `LAX`","metadata":{}},{"cell_type":"code","source":"#summarise() and group_by()\n\nflights %>%\nfilter (origin == \"JFK\" & dest == \"LAX\") %>%\ngroup_by (tailnum) %>%\nsummarise (mean_air_time = mean(air_time, na.rm = TRUE), n=n())","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#use group_by() and ungroup() without summarise()\n\nflights %>%\ndrop_na() %>%\ngroup_by(dest, origin) %>%\nmutate(\n    air_time_mean = mean(air_time),\n    air_time_sd = sd(air_time),\n    n = n()\n  ) %>%\n  ungroup() %>%\nfilter(origin=='EWR' & dest=='IAH') %>%\nhead()\n","metadata":{"execution":{"iopub.status.busy":"2022-05-05T18:30:22.04126Z","iopub.execute_input":"2022-05-05T18:30:22.043056Z","iopub.status.idle":"2022-05-05T18:30:22.175008Z"},"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## `count()`\n\nWhenever you do any aggregation, it’s always a good idea to include either a `count (n())`, or a count of non-missing values (`sum(!is.na(x))`). ","metadata":{}},{"cell_type":"code","source":"flights %>% \n  group_by(dest) %>% \n  summarise(\n    count = n(),\n    dist = mean(distance, na.rm = TRUE),\n    delay = mean(arr_delay, na.rm = TRUE)\n )","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Exercise 4\n\nCreate a new variable called`long_flight` where air_time is greater or equal 360. Count number of `long_flight`","metadata":{}},{"cell_type":"code","source":"#your code here","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"## Create a new column basis count option","metadata":{}},{"cell_type":"code","source":"flights %>%\n  mutate(long_flight = (air_time >= 6 * 60)) %>%\n  View()","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"Now need to count the number of long flights","metadata":{}},{"cell_type":"code","source":"flights %>%\n  mutate(long_flight = (air_time >= 6 * 60)) %>%\n  count(long_flight)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"The above two steps you can execute in a single line.","metadata":{}},{"cell_type":"code","source":"flights %>%\n  count(long_flight = air_time >= 6 * 60)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Exercise 5\n\nIn the original data set year, month and date contained as separate columns-based, use the `make_date` command to create new `date` column by combining `year`, `month` and `date`.","metadata":{}},{"cell_type":"code","source":"#your code here","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Plot\n\nYou may combine all functions and produce a plot with `ggplot2`\n\nTo plot your data using `ggplot2`, you specify three things:\n\n1. Your data\n2. Your aesthetics (for example, what's on the x-axis)\n3. Your layers (for example, barplot, scatterplot)","metadata":{}},{"cell_type":"code","source":"# Scatter plot of arr_delay vs dep_delay\nggplot(flights, aes(x = arr_delay, y = dep_delay)) +\n  geom_point()","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# Scatter plot of arr_delay vs dep_delay, drop na, filter by 'JFK' and 'LGA' and carrier\nggplot(flights %>% \n        drop_na() %>%  \n        filter(origin %in% c('LGA','JFK')),\n        aes(x = arr_delay, y = dep_delay, color=carrier)) +\ngeom_point()","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"## bar plot\n\nggplot(data=flights, mapping = aes(x = carrier)) +\n  geom_bar()","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Exercise 6\n\nExtract carriers that has more than 10000 rows of data and store as a new data frame called `top_carriers`","metadata":{}},{"cell_type":"code","source":"#your code here\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"#  Exercise 7\n\nDownload the gapminder data\n\n```\ngapminder_orig <- read.csv(\"https://raw.githubusercontent.com/swcarpentry/r-novice-gapminder/gh-pages/_episodes_rmd/data/gapminder-FiveYearData.csv\")\n# define a copy of the original dataset that we will clean and play with \ngapminder <- gapminder_orig\n```\nFilter countries \"Thailand\", \"America\" and \"Australia\" in 2006 and then select and show the `country` and `life expectancy` variables.\n","metadata":{}},{"cell_type":"code","source":"gapminder_orig <- read.csv(\"https://raw.githubusercontent.com/swcarpentry/r-novice-gapminder/gh-pages/_episodes_rmd/data/gapminder-FiveYearData.csv\")\n# define a copy of the original dataset that we will clean and play with \ngapminder <- gapminder_orig\nhead(gapminder)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"#your code here\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Exercise 8\n\nCreate new variable, `gdp`, from the gapminder data frame. `gdp` is equal to `gdpPercap` multiplied by `pop`. Show `Country` with the lowest`gdp`.","metadata":{}},{"cell_type":"code","source":"#your code here\n\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Exercise 9\n\nCompute the mean life expectancy and total `gdp` for each year.","metadata":{}},{"cell_type":"code","source":"#your code here\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Exercise 10\n\nPlot scatterplot where `x=gdpPercap`, `y=lifeExp` and `colour=continent` for year 2007.","metadata":{}},{"cell_type":"code","source":"#your code here\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"# Tidy Data\n\nThere’s a popular saying in Data Science that goes like this — *“Data Scientists spend up to 80% of the time on data cleaning and 20 percent of their time on actual data analysis”.* \n\n## The 3 rules of Tidy Data\n1. Each variable is a column\n2. Each observation is a row\n3. Each type of observational unit is a table\n\n## 5 symptoms of messy data\n1. Column headers are values, not variable names.\n2. Multiple variables are stored in one column.\n3. Variables are stored in both rows and columns.\n4. Multiple types of observational units are stored in the same table.\n5. A single observational unit is stored in multiple tables.","metadata":{}},{"cell_type":"markdown","source":"`tidyr` — set of functions to help you get tidy data. It’s the successor to reshape2(which uses melt and cast). It has 5 main categories\n\n- Pivoting → `pivot_longer()`& `pivot_wider()`\n- Rectangling → `unnest_longer()`, `unnest_wider()`, `hoist()`\n- Nesting → `nest()` & `unnest()`\n- Splittin