mes_to` is the name of the variable in the new “tidy” data frame that will contain the column names of the original data. Observe how we set `names_to = \"year\"`. In the resulting guat_dem_tidy, the column `year` contains the years where `country`'s democracy scores were measured.\n2. `values_to` is the name of the variable in the new “tidy” data frame that will contain the values of the original data. Observe how we set `values_to` = `democracy_score`. In the resulting `dem_tidy` the column democracy_score contains the `democracy scores` as numeric values.\n3. The third argument is the columns you either want to or don’t want to “tidy.” Observe how we set this to `cols = -country` indicating that we don’t want to “tidy” the country variable in dem_tidy.\n4. The last argument of `names_transform` tells R what type of variable `year` should be set to. Without specifying that it is an `integer` as we’ve done here, `pivot_longer()` will set it to be a character value by default.","metadata":{}},{"cell_type":"code","source":"## ggplot plot for China\nggplot(dem_tidy %>%\n       filter(country==\"China\"),\n       aes(x = year, y = democracy_score)) +\n  geom_line() +\n  labs(x = \"Year\", y = \"Democracy Score\")","metadata":{"execution":{"iopub.status.busy":"2022-05-07T05:11:20.445528Z","iopub.execute_input":"2022-05-07T05:11:20.447520Z","iopub.status.idle":"2022-05-07T05:11:20.673277Z"},"trusted":true},"execution_count":12,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2BUZdYG8HOnZSY9Ib2QkFBFEFhZaUqHoK7rKpbdz15XLOsKCwgogigosvoh\n1l1xddcV/XQVyxICUmVxKVJUkJKQhBTSSU9mMjPfH0evSAmTZO68tzy/v0IYyGFyyTzznvc9\nV/J6vQQAAAAA2mcSXQAAAAAA+AeCHQAAAIBOINgBAAAA6ASCHQAAAIBOINgBAAAA6ASCHQAA\nAIBOINgBAAAA6ASCHQAAAIBOWEQX4Ader9fr9dbV1Rl52HJISIjL5XI6naILEcZmszkcDr4S\nRNciUlhYWHNzc1tbm+hChLHb7UFBQW63u6GhQXQtwkiSFB4eXl9f7/F4RNciTHBwsNVqdblc\nTU1NomsRxmw2h4aG1tbWii5EpLCwMJPJ1Nra2tLSIroWv4mK